import React from 'react';
import '../';

function Categories() {
  return (
    <div className="categories" id="categories">
      <h2>Nossas Categorias de Veículos</h2>
      <div className="categories-grid">
        <div className="category-card">Híbridos e Elétricos</div>
        <div className="category-card">GNV com/sem D-Taxi</div>
        <div className="category-card">Carros Grandes (BAG)</div>
        <div className="category-card">Veículos Flex</div>
      </div>
    </div>
  );
}

export default Categories;
